import React, { useState, useEffect } from 'react';
import axios from 'axios';
import MapComponent from './Mapcomponent';
import './ListChargers.css'; // Assuming you have a CSS file for styling

const ListChargers = () => {
  const [chargers, setChargers] = useState([]);
  const [selectedCharger, setSelectedCharger] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:8080/api/chargers/getallchargers');
        setChargers(response.data);
      } catch (error) {
        console.error('Error fetching the chargers data', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>List of All Chargers</h1>
      <table>
        <thead className="table-header">
          <tr>
            <th>Longitude</th>
            <th>Latitude</th>
            <th>Rate/min</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {chargers.map((charger) => (
            <tr key={charger.id} className="table-row">
              <td>{charger.longitude}</td>
              <td>{charger.latitude}</td>
              <td>{charger.rate}</td>
              <td>
                <button onClick={() => setSelectedCharger(charger)}>
                  Show on Map
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      {selectedCharger && (
        <MapComponent
          lat={selectedCharger.latitude}
          lng={selectedCharger.longitude}
        />
      )}
    </div>
  );
};

export default ListChargers;
